  public static function semantic($i,&$words,&$fem,$f){ 
	// global static::$_1_2, static::$_1_19, static::$des, static::$hang, static::$namerub, static::$nametho, static::$namemil, static::$namemrd; 
	$words=""; 
	$fl=0; 
	if($i >= 100){ 
		$jkl = intval($i / 100); 
		$words.=static::$hang[$jkl]; 
		$i%=100; 
	} 
	if($i >= 20){ 
		$jkl = intval($i / 10); 
		$words.=static::$des[$jkl]; 
		$i%=10; 
		$fl=1; 
	} 
	switch($i){ 
		case 1: 
			$fem=1; 
		break; 
		case 2: 
		case 3: 
		case 4: 
			$fem=2; 
		break; 
		default: 
			$fem=3; 
		break; 
	} 
	if( $i ){ 
		if( $i < 3 && $f > 0 ){ 
			if ( $f >= 2 ) { 
				$words.=static::$_1_19[$i]; 
			}else{ 
				$words.=static::$_1_2[$i]; 
			} 
		}else { 
			$words.=static::$_1_19[$i]; 
		} 
	} 
} 


 public static function num2str($L){ 
	// global static::$_1_2, static::$_1_19, static::$des, static::$hang, static::$namerub, static::$nametho, static::$namemil, static::$namemrd, static::$kopeek; 

	$s=" "; 
	$s1=" "; 
	$s2=" "; 
	$kop=intval( ( $L*100 - intval( $L )*100 )); 
	$L=intval($L); 
	if($L>=1000000000){ 
		$many=0; 
		static::semantic(intval($L / 1000000000),$s1,$many,3); 
		$s.=$s1.static::$namemrd[$many]; 
		$L%=1000000000; 
	} 

	if($L >= 1000000){ 
		$many=0; 
		static::semantic(intval($L / 1000000),$s1,$many,2); 
		$s.=$s1.static::$namemil[$many]; 
		$L%=1000000; 
		if($L==0){ 
		$s.="рублей "; 
		} 
	} 

	if($L >= 1000){ 
		$many=0; 
		static::semantic(intval($L / 1000),$s1,$many,1); 
		$s.=$s1.static::$nametho[$many]; 
		$L%=1000; 
		if($L==0){ 
			$s.="рублей "; 
		} 
	} 

	if($L != 0){ 
		$many=0; 
		static::semantic($L,$s1,$many,0); 
		$s.=$s1.static::$namerub[$many]; 
	} 

	if($kop > 0){ 
		$many=0; 
		static::semantic($kop,$s1,$many,1); 
		$s.=$s1.static::$kopeek[$many]; 
	}else { 
		$s.=" 00 копеек"; 
	} 

	return $s; 
} 
	
